description:
Nguyễn An Ninh ,Đồng Tâm Hai Bà Trưng Hà Nội 
MỚI ĐẸP - THANG MÁY - CÁCH PHỐ 15M - NGÕ CHỈ 5 NHÀ RA PHỐ
+ Nhà 6 tầng
 - Tầng 1: Bếp, để xe, vệ sinh, thang máy, thang bộ;
 - Tầng 2: Phòng khách lớn, vệ sinh;
 - Tầng 3, 4, 5: 2 phòng riêng biệt + 2 vệ sinh; 
 - Tầng 6: Tum, sân mái che.
+ Các phòng trang bị điều hòa, rèm. Bếp trang bị hút mùi xịn.
+ Pháp lý sổ chuẩn
 *** Giá : 9,15 tỷ
